/*
Tipos de dados Alfanuméricos ou Caracteres
- Diferenças entre tipos de dados CHAR e VARCHAR 
- Tipos de dados de tamanho fixo e variável  
- Tipo de variável MAX.

Depois teremos uma aula somente para tratar dados UNICODE.
*/


/*
Tipos de dados Caracter 
*/

/*
O SQL Server oferece suporte para diversos tipos de dados alfanuméricos ou
caracter. 

Vamos ver os tipo CHAR e VARCHAR 

*/


-- CHAR 
/*
Representa o tipo de dado de tamanho fixo. 
Voce declara o tipo de dados : CHAR(n) , onde n é o tamanho 
máximo de caracters que esse tipo de dados armezenará. 

Limite para o tamanho máximo :

CHAR - até 8000 bytes 

Com isso, o SQL Server reservará "n" caracters para armazenar o dados, utilizando ou não
todos os caracteres.  

*/
use DBExemplo
go

drop table if exists Teste
go

Create Table Teste (
  Nome char(10)
)

insert into Teste (Nome) values ('Jose')

select * from Teste

----------
JOSE      |
----------

select '['+nome+']' from Teste

select datalength(nome) from teste

/*
O SQL Server não tem processo de expandir ou comprimir a coluna. O dados é
armazenado com o tamanho de acordo com o valor declarado no tipo do dado.

*/

insert into Teste (Nome) values ('Jose da Silva') -- 13 letras !!

/*
Msg 8152, Level 16, State 14, Line 107
String or binary data would be truncated.
The statement has been terminated.
*/

-- VARCHAR 

/*
Representa o tipo de dado de tamanho variado.
Voce declare o tipo de dado : VARCHAR(n) , onde "n" é o 
tamanho máximo de caracteres que pode ser armazenado. 

Limite para o tamanho máximo :

VARCHAR  - até 8000 bytes 

Já neste caso, o SQL SERVER armazenará somente os caracteres utilizados 
neste tipo de dados, respeitando o limite declarado. 
*/

use DBExemplo
go

drop table if exists Teste 
go

Create Table Teste (
   Nome1 char(10) ,
   Nome2 varchar(10)
)

insert into Teste (Nome1,Nome2) values ('Jose','Jose')

select * from Teste

-----
JOSE|
-----

select '['+nome1+']' as Nome1, 
       '['+nome2+']' as Nome2 
  from Teste


/*
O consumo de espaço é reduzido e as leituras são mais rápidas. 
Mas existe um overhead de processamento para reduzir ou expandir o dados 
no processo de gravação. 
*/


