/*
Alguns erros que podem ocorrer 
*/
use DBExemplo
go

drop table if exists dbo.Teste 
go

Create Table dbo.Teste (
Titulo char(100),
Descricao char(9000)
)

/*
Msg 131, Level 15, State 2, Line 118
The size (9000) given to the column 'Descricao' exceeds the maximum 
allowed for any data type (8000).
*/
go

drop table if exists dbo.Teste 
go

Create Table dbo.Teste (
Titulo char(5000),
Descricao char(5000)
)

/*
Msg 1701, Level 16, State 1, Line 129
Creating or altering table 'Teste' failed because the minimum row 
size would be 10007, including 7 bytes of internal overhead. 
This exceeds the maximum allowable table row size of 8060 bytes.
*/

drop table if exists dbo.Teste 
go

Create Table dbo.Teste (
Titulo varchar(5000),
Descricao varchar(5000)
)






/*
Quando usar CHAR ou VARCHAR ?? 

CHAR
1. Dados fixos, onde os valores não sofrem variação de tamanho.
2. Dados de tamanho pequeno.
3. Sistemas com muitas gravações (INSERT e UPDATE) 

VARCHAR
1. Dados variados, com grandes variações de tamanho do valor.
2. Dados grandes.
3. Sistemas com muitas leituras.

*/


-- VARCHAR(MAX) 

/*
Esse tipo de dados é utilizado quando voce deseja armazenar texto de 
até 2Gb.
*/

